import {FC} from "react";
import {ViewPropsType} from "../@types/ButtonControlsType";
import {text} from "stream/consumers";

const ButtonControls: FC<ViewPropsType> = (props) => {

  return (
    <>
      <form>
        <input type="text" id="1" onChange={props.onInputChange} value={props.inputValues.input_1}/>
        <button type="button" id="1" onClick={props.onInputClear}>Clear</button>
        <button type="button" id="1" onClick={props.onInputDefaultText}>Text</button>
      </form>
      <form>
        <button type="button" id="2" onClick={(e) => props.onAlertInput(e, "num")}>Num?</button>
        <input type="text" id="2" onChange={props.onInputChange} value={props.inputValues.input_2}/>
        <button type="button" id="2" onClick={(e) => props.onAlertInput(e, "text")}>Alert</button>
      </form>
    </>
  )
}

export default ButtonControls
